import { Text, StyleSheet, View } from 'react-native';

const Header = () => {
  return (
    <View style={styles.header}>
      <Text style={styles.text}>Academy header</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  header: {
    backgroundColor: 'orange'
  },
  text: {
    fontSize: 30
  }
});

export default Header;
